import React from 'react'
import Atividade from "./components/Atividade";

export default function AtividadesLista(props) {
    return (
        <div className="mt-5">
        {props.listaAtividades.map((ativ) => (
          <Atividade
            key={ativ.Id}
            ativ={ativ}
            deletarAtividade={props.deletarAtividade}
          />
        ))}
      </div>
    )
}
